import React from 'react';
import {Row, Col} from 'reactstrap';

export const Contact = () => {
    return (
        <div className="contactDiv" style={{marginTop:"3rem"}} >
        <Row xs="2">
        <Col className="contactTitle" style={{textAlign:"right"}}>Phone:</Col>
        <Col className="contactTitle" style={{textAlign:"left"}}>+91 7276072667</Col>
        <Col className="contactTitle" style={{textAlign:"right"}}>E-Mail:</Col>
        <Col className="contactTitle" style={{textAlign:"left"}}>maithiaharsh@gmail.com</Col>
        <Col className="contactTitle" style={{textAlign:"right"}}>Phone:</Col>
        <Col className="contactTitle" style={{textAlign:"left"}}>+91 7276072667</Col>
        <Col className="contactTitle" style={{textAlign:"right"}}>E-Mail:</Col>
        <Col className="contactTitle" style={{textAlign:"left"}}>maithiaharsh@gmail.com</Col>
      </Row>
        </div>
    )
}
